s($,"brL","b8c",()=>new A.nL("MacMaurice Osuji","I\u2019m a mobile developer working with Flutter, and on occasion SwiftUI, building cross-platform and native iOS apps that feels smooth and user-first. My background from Harvard's CS50 course taught me to think in systems, but I balance that with creativity. I design most of the assets in my projects, from layouts to icons, all because I enjoy shaping the whole experience, not just the code. Curious by nature, I\u2019m always learning, experimenting with new tools and ideas, finding fresh ways to make an app stand out.","mailto:macmauriceosuji@gmail.com","Port Harcourt, Nigeria","I\u2019m MacMaurice Osuji, a mobile developer who loves turning ideas into smooth, functional apps. I build with Flutter and sometimes SwiftUI, creating both cross-platform and native iOS experiences that looks good and runs fast too. My background from Harvard's CS50 course shaped how I think about systems, algorithms, precision, and structure, which I now apply in my codes.\nSince 2023, I\u2019ve worked as a freelance developer on Upwork, designing apps backed by Firebase, Riverpod, and Provider for clean state management and real-time performance. I enjoy solving bugs, refining UIs, and making sure every app feels right in the user\u2019s hands.\nI also have a mechanical engineering degree from Alex Ekwueme Federal University, Ebonyi State, Nigeria, where I led projects and improved my leadership and documentation skills. That experience taught me endurance, accountability, and how to deliver under pressure, skills I carry into mobile development.\nI\u2019m always learning, experimenting, and pushing my limits. For me, development is not just about writing code; it\u2019s about building tools that work, perform, and leave an impression.","assets/profile_img.jpg","https://mcmaurice.github.io/assets/assets/resume.pdf","https://x.com/jxt_lastborn","https://www.linkedin.com/in/macmauriceosuji/","https://github.com/McMaurice","https://www.google.com/maps?q=Portharcourt,Nigeria","I have a lot of ideas waiting to be harnessed, and very open to collaborations. Let's engineer ideas into reality.","My skills span engineering design, software development, and project execution. This mix allows me to design apps with precision and develop digital products that perform reliably. I approach every project with a balance of technical depth, practical thinking, and efficiency, ensuring both hardware and software solutions meet real-world performance standards.","I use tools and languages chosen for their balance of performance, scalability, and simplicity. Each one serves a defined purpose in my workflow. Flutter and SwiftUI help me build smooth and responsive user interfaces. Firebase handles backend services and real-time data. Git and GitHub keep my codebase clean and versioned across projects. Together, these tools let me design, build, and deploy efficient mobile and web solutions with speed and precision.",B.RE,B.RX,B.SO,B.Rf,B.RT,B.SB))
